import logo from './logo.svg';
import pic1 from './pic1.jpeg';
import './App.css';
import $ from 'jquery';
import React from 'react';


function changeCss () {
  var appElement = document.querySelector("#App");
  this.scrollY > 500 ? appElement.style.width = '500px' : appElement.style.width = '1920px';
}

window.addEventListener("scroll", changeCss , false);



function App() {
  return (
  <>

      <div id="App" className="sticky"  ></div>

      <div id ="picture" className="sticky"><img id ='picture1' src={pic1} alt="picture1" /></div>
  </>
  );
}



export default App;
